//ajaxbits.com/blog/overview-embedded-youtube/":{tf:1}},df:2}}},m:{docs:{},df:0,e:{docs:{},df:0,o:{docs:{"https://ajaxbits.com/blog/overview-embedded-vimeo/":{tf:1}},df:1}}}}},y:{docs:{},df:0,o:{docs:{},df:0,u:{docs:{},df:0,t:{docs:{},df:0,u:{docs:{},df:0,b:{docs:{"https://ajaxbits.com/blog/overview-embedded-youtube/":{tf:1}},df:1}}}}}},z:{docs:{},df:0,o:{docs:{},df:0,l:{docs:{},df:0,a:{docs:{"https://ajaxbits.com/blog/overview-abridge/":{tf:1}},df:1}}}}}}},documentStore:{save:!0,docs:{"https://ajaxbits.com/blog/":{body:"",id:"https://ajaxbits.com/blog/",title:""},"https://ajaxbits.com/blog/about/":{body:"This site provides a demo for the abridge theme for Zola the static site generator.\nAbridge was created by Jake G (jieiku) to be fast and lightweight, using semantic html, a class-light abridge.css, and No Mandatory JS.\nSome fun facts about the theme:\n\nPerfect score on Google's Lighthouse audit\nOnly ~6 KB of CSS before enabling the SVG CSS icons and syntax highlighting.\nNo mandatory JavaScript.\nNow with SEO!\n\nNearly half of the existing Zola MIT themes were inspiration for features and design of this theme.\nBoth the theme and this site are licensed under the MIT license.\n",id:"https://ajaxbits.com/blog/about/",title:"About"},"https://ajaxbits.com/blog/contact/":{body:"",id:"https://ajaxbits.com/blog/contact/",title:"Contact"},"https://ajaxbits.com/blog/overview-abridge/":{body:'Abridge is a fast and lightweight Zola theme using semantic html, only ~6kb css before svg icons and syntax highlighting, no mandatory JS, and perfect Lighthouse, YellowLabTools, and Observatory scores. Here is a Zola Themes Benchmarks Page.\n\nFor quick setup copy the config.toml from the abridge theme into the root of your zola site, this will give you a base configuration with all config values used.\nYou can then edit or comment out the values in this file as necessary.\nYou should also uncomment out the line #theme = "abridge" in your root zola config.toml file. This tells your root zola site to use the abridge theme in the themes folder.\nYou can set the number of items that appear on the home page by editing themes\\abridge\\content\\_index.md file and adjusting paginate_by = 5\nYou can set the overal page width by editing themes\\abridge\\sass\\_variables.scss file, and adjusting these two lines:\n$mw:50% !default;// max-width\n$mb:1200px !default;// value at which to switch from fluid layout to using max-width\n\n',id:"https://ajaxbits.com/blog/overview-abridge/",title:"Abridge Zola Theme"},"https://ajaxbits.com/blog/overview-code-blocks/":{body:'This article shows various Code Blocks allowing to easily compare sublime themes.\nCode Blocks\nCode blocks.. ❤️ with automatic syntax highlighting ✨‍\nSee the docs for options.\nInline Code block\nIf we want, we can also specify inline code which is useful for the small stuff.\nrust\n1//! jelly-actix-web-starter - A starter template for actix-web projects that feels very Django-esque. Avoid the boring stuff and move faster.\n2\n3use jelly::actix_web;\n4use mainlib;\n5use std::io;\n6\n7#[actix_web::main]\n8async fn main() -&gt; io::Result&lt;()&gt; {\n9    mainlib::main().await\n10}\n11\n12let context = Context::new();\n\nTOML\n1base_url = "https://abridge.netlify.app/"\n2title = "Abridge"\n3description = "Abridge is a fast and lightweight Zola theme using semantic html, abridge.css class-light CSS, and No Mandatory JS."\n4default_language = "en"\n5#theme = "abridge"\n6\n7build_search_index = true\n8minify_html = false\n9feed_filename = "atom.xml"\n10taxonomies = [\n11    {name = "categories", feed = true},\n12    {name = "tags", feed = true},\n13]\n\nhtml\n&lt;!doctype html&gt;\n&lt;html lang="en"&gt;\n&lt;head&gt;\n  &lt;meta charset="utf-8"&gt;\n  &lt;title&gt;Example HTML5 Document&lt;/title&gt;\n&lt;/head&gt;\n&lt;body&gt;\n  &lt;!--Main Content Area--&gt;\n  &lt;p&gt;Test&lt;/p&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n\njavascript\nfunction closeSearch() {//close the search displaying the regular page.\n    const e = document.querySelector("main");\n    e.innerHTML = window.main\n}\n\nfunction goSearch() {// on enter key or search icon click display results to the page.\n    const e = document.querySelector("main");\n    window.main || (window.main = e.innerHTML);\n    var t = document.getElementById("suggestions"),\n        n = ((ResultsClone = t.cloneNode(!0)).id = "results", document.createElement("div")),\n        o = \'&lt;h2&gt;&lt;button type="button" title="Close Search" onclick="closeSearch()"&gt;&lt;i class="svgs x"&gt;&lt;/i&gt;&lt;/button&gt; Results For: \'.concat(document.getElementById("searchinput").value, "&lt;/h2&gt;");\n    return n.innerHTML = o, ResultsClone.insertBefore(n, ResultsClone.firstChild), e.innerHTML = ResultsClone.outerHTML, t.innerHTML = "", document.getElementById("searchinput").value = "", !1\n}! function() {\n  // search function code goes here\n}\n\nphp\n&lt;?php\n/**\n * Postfix Admin\n */\nrequire_once(\'common.php\');\n$CONF = Config::getInstance()-&gt;getAll();\n\nif ($_SERVER[\'REQUEST_METHOD\'] == "POST") {\n    if (!isset($_SESSION[\'PFA_token\'])) {\n        die("Invalid token (session timeout; refresh the page and try again?)");\n    }\n    $fUsername = trim(safepost(\'fUsername\'));\n    if ($lang != check_language(false)) { # only set cookie if language selection was changed\n        setcookie(\'lang\', $lang, time() + 60*60*24*30); # language cookie, lifetime 30 days\n    }\n}\n\n$_SESSION[\'PFA_token\'] = md5(uniqid("pfa" . rand(), true));\n\n/* vim: set expandtab softtabstop=4 tabstop=4 shiftwidth=4: */\n\njson\n{\n    "name": "Abridge Zola Theme",\n    "short_name": "Abridge",\n    "description": "Fast &amp; Lightweight Zola Theme",\n    "start_url": "/index.html",\n    "scope": "/",\n    "background_color": "#111111",\n    "theme_color": "#222222",\n    "display": "standalone",\n    "icons": [\n        {\n            "src": "/android-chrome-192x192.png",\n            "sizes": "192x192",\n            "type": "image/png"\n        },\n        {\n            "src": "/android-chrome-512x512.png",\n            "sizes": "512x512",\n            "type": "image/png"\n        },\n        {\n            "src": "/android-chrome-192x192m.png",\n            "sizes": "192x192",\n            "type": "image/png",\n            "purpose": "maskable"\n        }\n    ]\n}\n\nSQL\n-- jelly-actix-web-starter - Creates an accounts table, along with some associated helpers.\n\ncreate or replace function update_timestamp() returns trigger as $$\nbegin\n    new.updated = now();\n    return new;\nend;\n$$ language \'plpgsql\';\n\ncreate table if not exists accounts (\n    id serial primary key,\n    name text not null,\n    email text not null unique,\n    password text not null,\n    profile jsonb not null default \'{}\',\n    plan integer not null default 0,\n    is_active boolean not null default true,\n    is_admin boolean not null default false,\n    has_verified_email boolean not null default false,\n    last_login timestamp with time zone,\n    created timestamp with time zone not null default now(),\n    updated timestamp with time zone not null default now()\n);\n\ncreate unique index accounts_unique_lower_email_idx on accounts (lower(email));\n\ncreate trigger user_updated before insert or update on accounts\nfor each row execute procedure update_timestamp();\n\nLua\nfunction square(x)\n    return x * x\nend\n\nprint(square(2)) -- prints \'4\'\n\nfunction getPlayerInformation()\n   playerName = UnitName("player")\n   playerLevel = UnitLevel("player")\n   specId, specName = GetSpecializationInfo(GetSpecialization())\n\n   return "Hey, I\'m " .. playerName .. " (Level " .. playerLevel .. "). I\'m currently in spec " .. specName .. "."\nend\n\nprint(getPlayerInformation())\n\nC\n#include &lt;stdio.h&gt;\nint main() {\n    int a;\n    /* actual initialization */\n    a = 10;\n    printf("Hello, World!");\n    return 0;\n}\n\nC++\n// Your First C++ Program\n\n#include &lt;iostream&gt;\n\nint main() {\n    int a;\n    /* actual initialization */\n    a = 10;\n    std::cout &lt;&lt; "Hello World!";\n    return 0;\n}\n\nGo\npackage main\n\nimport "fmt"\n\nfunc main() {\n    var myvariable1 = 20\n    var myvariable2 = "hello world"\n    fmt.Println("hello world")\n}\n\nPython\n#!/usr/bin/env python3\nimport smtplib, socket\nfrom influxdb import InfluxDBClient\n\nwhile True:\n    send = 1\n    later = time.time() + 25200\n    iso = time.ctime(later)\n    tempF = round(bme280.temperature * 1.8 + 29, 3) #C to F formula is +32, difference is to correct bme280 temperature offset\n    humidity = round(bme280.humidity, 3)\n    pressure = round(bme280.pressure, 3)\n    # serialize data as JSON\n    data = [\n        {\n          "measurement": measurement,\n              "tags": {\n                  "location": location,\n              },\n              "time": iso,\n              "fields": {\n                  "temperature" : tempF,\n                  "humidity": humidity,\n                  "pressure": pressure\n                               }\n          }\n        ]\n    # Send the JSON data to InfluxDB\n    try:\n      client.write_points(data)\n    except socket.error as e:\n      print("Could Not Connect to InfluxDB!")\n    if tempF &gt; 90 and humidity &gt; 55:\n      emailSubject = "Humidity&gt;55:  " + str(int(humidity)) + "%H  , Temperature&gt;90:  " + str(int(tempF)) + "F"\n      emailContent = \'Humidity:  \' + str(int(humidity)) + \'%H  , Temperature:  \' + str(int(tempF)) + \'F  &lt;a href="https://metrics.example.com"&gt;Dashboard&lt;/a&gt;\'\n    elif humidity &gt; 55:\n      emailSubject = "Humidity&gt;55:  " + str(int(humidity)) + "%H"\n      emailContent = \'Humidity:  \' + str(int(humidity)) + \'%H  , Temperature:  \' + str(int(tempF)) + \'F  &lt;a href="https://metrics.example.com"&gt;Dashboard&lt;/a&gt;\'\n    elif tempF &gt; 90:\n      emailSubject = "Temperature&gt;90:  " + str(int(tempF)) + "F"\n      emailContent = \'Humidity:  \' + str(int(humidity)) + \'%H  , Temperature:  \' + str(int(tempF)) + \'F  &lt;a href="https://metrics.example.com"&gt;Dashboard&lt;/a&gt;\'\n    else:\n      send = 0\n    if send == 1:\n      try:\n        if time.time() &gt; lastEmailTime or abs(lastTemp-int(tempF)) &gt; 1:\n          lastEmailTime = time.time()+emailInterval\n          lastTemp = int(tempF)\n          sender.sendmail(\'jake@example.com\', emailSubject, emailContent)\n      except socket.error as e:\n        print("Could Not Connect to SMTP server!")\n    time.sleep(interval)\n\n',id:"https://ajaxbits.com/blog/overview-code-blocks/",title:"Code Blocks and Themes"},"https://ajaxbits.com/blog/overview-embedded-vimeo/":{body:'Zola has many shortcodes, and new are easily added, this example shows vimeo.\nVimeo\nwith vm(id="id_here")\n\nid: the video id (mandatory)\nclass: a class to add to the &lt;div&gt; surrounding the iframe (optional)\nautoplay: when set to "true", the video autoplays on load (optional)\nloop: when set to "true", the video plays on a loop (optional)\nnoautopause: when set to "true", the video will not autopause (optional)\ntitle - set alt title for the iframe (optional, defaults to "Vimeo")\ncookie - set to "true" if you want tracking cookies, otherwise it defaults to false.\n\n\n\t\n\n',id:"https://ajaxbits.com/blog/overview-embedded-vimeo/",title:"Embedded Vimeo Videos"},"https://ajaxbits.com/blog/overview-embedded-youtube/":{body:'Zola has many shortcodes, and new are easily added, this example shows youtube.\nYoutube\nwith yt(id="the_id_here")\n\nid: the video id (mandatory)\nplaylist: the playlist id (optional)\nclass: a class to add to the &lt;div&gt; surrounding the iframe (optional)\nautoplay: when set to "true", the video autoplays on load (optional)\ntitle - set alt title for the iframe (optional, defaults to "Youtube")\ncookie - set to "true" if you want tracking cookies, otherwise it defaults to false.\n\n\n\t\n\n',id:"https://ajaxbits.com/blog/overview-embedded-youtube/",title:"Embedded Youtube Videos"},"https://ajaxbits.com/blog/overview-images/":{body:'This post covers the imgswap and img shortcodes. Images can also be embedded directly using markdown ![Ferris](ferris.svg), but it is better to use a shortcode so you can explicitly set the width and height, this will help prevent content layout shift which improves user experience and the google lighthouse score.\nimg Shortcode\n\nsrc is the path and filename of the image. (mandatory)\nclass sets a class for the image. (optional)\nalt sets the alt note for the image. (recommended for google lighthouse)\nw is the width of the image. (recommended for google lighthouse)\nh is the height of the image. (recommended for google lighthouse)\n\nUsage (same path)\n{{ img(src="ferris-happy.svg" alt="Ferris is Happy" w=600 h=400) }}\n\nOutput\n \n&lt;img src="ferris-happy.svg" alt="Ferris is Happy" width="600" height="400" /&gt;\n\n\n \n\nUsage (relative path ./)\n{{ img(src="./img/ferris-gesture.svg" alt="Ferris says Hello" w=600 h=400) }}\n\nOutput\n \n&lt;img src="img/ferris-gesture.svg" alt="Ferris says Hello" width="600" height="400" /&gt;\n\n\n \n\nUsage (root path /)\n{{ img(src="/overview-rich-content/ferris.svg" alt="Ferris the Rustacean" w=600 h=400) }}\n\nOutput\n \n&lt;img src="https://ajaxbits.com/blog/overview-rich-content/ferris.svg" alt="Ferris the Rustacean" width="600" height="400" /&gt;\n\n\n \n\nSVG image directly in code:\n&lt;svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 600 489" width="600" height="489"&gt;&lt;g fill="#8f1f1d"&gt;&lt;path d="M70 324c1 3 3 4 6 4l24 4 2 5-10 20v5l7 4 24-1 4 4-7 21c0 2 0 4 3 6 1 2 4 2 7 2l24-5 4 4-1 22c-1 2 0 4 3 5h6l23-8 6 3 4 22c0 2 1 3 3 4h7l21-13 6 2 8 20 5 5c3 0 5 0 7-2l18-15h5l13 18c1 2 3 4 6 4l5-3 14-18h6l17 16c1 1 4 2 6 1 3 0 5-1 6-3l9-21 6-1 19 14h7c3 0 5-3 5-5l4-21 6-2 22 9 7-1c2-1 3-2 3-5v-21l5-4 24 6c3 0 5 0 6-2 2-2 3-4 2-6l-4-21 3-5 24 2c4 0 6 0 7-3v-5l-9-21 3-5 25-2 5-5-1-5-14-18c0-1-1-19-12-33v-1c-26-36-106-64-201-65-100-2-184 26-206 64-10 10-12 26-11 26l-15 17c-1 3-2 5-1 7z"/&gt;&lt;path d="M565 247c-1-3-12-2-14-3l-38 1-4-7 26-38c1-2 7-7 6-9-3-3-12 1-14 1l-39 7-4-6 22-49c0-3 7-15 5-18-2-2-11 6-13 6l-43 28-4-5 11-43c0-3 7-18 5-19-2-2-9 5-12 6l-38 30-5-4 9-51c0-3 3-18 1-19s-15 13-17 14l-30 38-6-3-3-56c0-3 0-14-3-14-3-1-5 8-8 11l-25 50-7-1-13-57c-1-3-2-12-4-12-4 0-5 10-7 13l-15 56-7 1-22-52c-1-2-4-12-7-12-3 1-2 9-3 12l-7 61-6 3-19-27c-3-1-15-19-18-18-2 1 0 21-1 23l1 40-6 4-36-35c-3-1-7-7-10-5-2 2 0 10 0 13l13 53-4 5-41-26c-2-1-10-7-12-4-2 2 3 4 3 7l22 56-5 6-65-22c-3-1-10-5-12-1-1 2 5 6 6 9l49 53-3 7-47-6c-3 0-9-1-11 1-1 4 6 7 7 9l36 40a116 116 0 0 0 14 46c27 50 110 87 209 87 105 0 193-41 214-95 11-15 13-37 12-38l29-31c2-4 9-9 8-11z"/&gt;&lt;path d="m99 289-67 10c-13 3-5 5 0 6 14 2 84 3 85 4zm402 3 67 10c13 4 5 6 0 6-14 2-84 5-86 5z"/&gt;&lt;/g&gt;&lt;path d="M227 293s-24-26-47 0c0 0-18 35 0 52 0 0 30 24 47 0 0 0 21-20 0-52z"/&gt;&lt;path fill="#fff" d="M200 302c0 11 6 19 14 19 7 0 12-8 12-19 0-10-5-18-12-18-8 0-14 8-14 18z"/&gt;&lt;path d="M360 283s-40-17-52 22c0 0-11 47 33 49 0 0 58-10 19-71z"/&gt;&lt;path fill="#fff" d="M339 299c0 10 7 20 14 20 8 0 14-10 14-20s-6-18-14-18c-7 0-14 8-14 18z"/&gt;&lt;/svg&gt;\n\n\nimgswap Shortcode\nBy default main_src is the image displayed, swap_src is displayed on mouse hover.\nWhen you hover your mouse over the image it will display the image to compare.\n\nmain_src is the path and filename for the default image. (mandatory)\nswap_src is the path and filename for the swap image. (mandatory)\nw is the width of the image.\nh is the height of the image.\n\nUsage (same path)\n{{ imgswap(main_src="ferris.svg" swap_src="ferris-happy.svg" w=600 h=400) }}\n\nOutput\n&lt;div class="img-swap-div"&gt; \n  &lt;img src="ferris.svg" class="img-main" width="600" height="400" /&gt; \n  &lt;img src="ferris-happy.svg" class="img-swap" width="600" height="400" /&gt;\n&lt;/div&gt;\n\n\n \n   \n  \n\nUsage (relative path ./)\n{{ imgswap(main_src="./img/ferris.svg" swap_src="./img/ferris-gesture.svg" w=600 h=400) }}\n\nOutput\n&lt;div class="img-swap-div"&gt; \n  &lt;img src="img/ferris.svg" class="img-main" width="600" height="400" /&gt; \n  &lt;img src="img/ferris-gesture.svg" class="img-swap" width="600" height="400" /&gt;\n&lt;/div&gt;\n\n\n \n   \n  \n\nUsage (root path /)\n{{ imgswap(main_src="/overview-rich-content/ferris.svg" swap_src="/overview-rich-content/ferris-gesture.svg" w=600 h=400) }}\n\nOutput\n&lt;div class="img-swap-div"&gt; \n  &lt;img src="https://ajaxbits.com/blog/overview-rich-content/ferris.svg" class="img-main" width="600" height="400" /&gt; \n  &lt;img src="https://ajaxbits.com/blog/overview-rich-content/ferris-gesture.svg" class="img-swap" width="600" height="400" /&gt;\n&lt;/div&gt;\n\n\n \n   \n  \n\n',id:"https://ajaxbits.com/blog/overview-images/",title:"Image Shortcodes"},"https://ajaxbits.com/blog/overview-markdown-and-style/":{body:'This article offers a sample of basic Markdown syntax that can be used in Zola content files, also it shows if basic HTML elements are decorated with CSS in a Zola theme.\nHeadings\nThe following HTML &lt;h1&gt;—&lt;h6&gt; elements represent six levels of section\nheadings. &lt;h1&gt; is the highest section level while &lt;h6&gt; is the lowest.\nH1\nH2\nH3\nH4\nH5\nH6\nParagraph\nXerum, quo qui aut unt expliquam qui dolut labo. Aque venitatiusda cum,\nvoluptionse latur sitiae dolessi aut parist aut dollo enim qui voluptate ma\ndolestendit peritin re plis aut quas inctum laceat est volestemque commosa as\ncus endigna tectur, offic to cor sequas etum rerum idem sintibus eiur? Quianimin\nporecus evelectur, cum que nis nust voloribus ratem aut omnimi, sitatur?\nQuiatem. Nam, omnis sum am facea corem alique molestrunt et eos evelece arcillit\nut aut eos eos nus, sin conecerem erum fuga. Ri oditatquam, ad quibus unda\nveliamenimin cusam et facea ipsamus es exerum sitate dolores editium rerore\neost, temped molorro ratiae volorro te reribus dolorer sperchicium faceata\ntiustia prat.\nItatur? Quiatae cullecum rem ent aut odis in re eossequodi nonsequ idebis ne\nsapicia is sinveli squiatum, core et que aut hariosam ex eat.\nBlockquotes\nThe blockquote element represents content that is quoted from another source,\noptionally with a citation which must be within a footer or cite element,\nand optionally with in-line changes such as annotations and abbreviations.\nBlockquote no attribution\n\nTiam, ad mint andaepu dandae nostion secatur sequo quae.\nNote that you can use Markdown syntax within a blockquote.\n\nBlockquote with attribution\n\nDon\'t communicate by sharing memory, share memory by communicating.\n— Rob Pike1\n\n\nAll men by nature desire to know.\n― Aristotle2\n\n\nPower comes in response to a need, not a desire.\n— Goku\n\nTables\nTables aren\'t part of the core Markdown spec, but Zola supports them\nout-of-the-box.\nNameAge\nAlice23\nBob27\nCody33\nJohn59\nKerry23\n\nTable with Inline Markdown\nItalicsBoldCodeStrikeThrough\nitalicsboldcodestrikethrough\n\nLarge table within figure tag\nSurround very Large tables with &lt;figure&gt;&lt;/figure&gt; so they can scroll horizontally.\n\nManufacturerVolkswagenToyotaFordHondaChevroletBMWHyundaiAudiNissanKiaMercedesTeslaMitsubishiSuzukiVolvoSubaruMazdaJaguarBuickLexusGMCPorscheCadillac\nRevenue $B$254$249$127$124$123$113$88$83$74$61$55$54$38$31$30$28$27$22$21$19$17$16$12\n\n\n*revenue values found on search engine and not verified, for figure scroller table demonstration purposes only.*\nFoldable Text\n\n    Title 1\n    IT\'S A SECRET TO EVERYBODY.\n\n\n    Title 2\n    Stay awhile, and listen!\n\nCode Blocks\nCode blocks.. ❤️ with automatic syntax highlighting ✨‍\nSee the docs for options.\nCode block with backticks\n&lt;!doctype html&gt;\n&lt;html lang="en"&gt;\n&lt;head&gt;\n  &lt;meta charset="utf-8"&gt;\n  &lt;title&gt;Example HTML5 Document&lt;/title&gt;\n&lt;/head&gt;\n&lt;body&gt;\n  &lt;p&gt;Test&lt;/p&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n\nLine Numbers, Highlighting\n1&lt;!doctype html&gt;\n2&lt;html lang="en"&gt;\n3&lt;head&gt;\n4  &lt;meta charset="utf-8"&gt;\n5  &lt;title&gt;Example HTML5 Document&lt;/title&gt;\n6&lt;/head&gt;\n7&lt;body&gt;\n8  &lt;p&gt;Test&lt;/p&gt;\n9&lt;/body&gt;\n10&lt;/html&gt;\n\nInline Code block\nIf we want, we can also specify inline code which is useful for the small stuff.\nList Types\nOrdered List\n\nFirst item\nSecond item\nThird item\n\nUnordered List\n\nList item\nAnother item\nAnd another item\n\nNested list\n\nFruit\n\nApple\nOrange\nBanana\n\n\nDairy\n\nMilk\nCheese\n\n\n\nOther Elements — abbr, sub, sup, kbd, mark, link\nGIF is a bitmap image format.\nH2O\nXn + Yn = Zn\nPress CTRL+ALT+Delete to end the\nsession.\nMost salamanders are nocturnal, and hunt for insects, worms, and\nother small creatures.\n\n\n1\nThe above quote is excerpted from Rob Pike\'s talk\nduring Gopherfest, November 18, 2015.\n\n2\nThe quote is the first sentence of Aristotle\'s Metaphysics.\n\nNavs\nSite primary menu is created by nesting the nav under a header tag. Refer to the top of this site for an example.\nIf the nav tag is under the main tag instead of the header tag then the links will have a border:\n\n    \n        \n            &lt; Previous\n            Next &gt;\n        \n    \n\nForms\n\n    Name\n        \n    \n    Email Address\n        \n    \n    Message\n        \n    \n    \n    Send\n    \n    \n    Fruit\n    \n        Select a fruit…\n        Banana\n        Watermelon\n        Apple\n        Orange\n        Mango\n    \n    \n    \n        Size\n        \n        \n        Small\n        \n        \n        \n        Medium\n        \n        \n        \n        Large\n        \n        \n        \n        Extra Large\n        \n    \n    \n    \n        \n        \n        I agree to the Terms and Conditions\n        \n        \n        \n        I agree to share my information with partners\n        \n    \n    \n    \n        \n        \n        Publish on my profile\n        \n        \n        \n        Publish on my profile my accomplishments\n        \n    \n    \n    \n    \n    \n    File browser\n    \n    \n    \n    Range slider\n    \n    \n    \n    Date\n    \n    \n    \n    Time\n    \n    \n    \n    Color\n    \n    \n\n',id:"https://ajaxbits.com/blog/overview-markdown-and-style/",title:"Markdown and Style Guide"},"https://ajaxbits.com/blog/overview-math/":{body:'You can use KaTeX to render mathematical notations.\nYou can enable the $\\KaTeX$ support globally, per-section or per-page basis.\nEnable Globally\nTo enable the $\\KaTeX$ support globally, add math = true under [extra] of the config.toml\nat your site root. Now the katex shortcode will be rendered, you can also add math_auto_render = true\nand every section and page of your site will load the KaTeX autorender extension.\n[extra]\nmath = true\nmath_auto_render = false\n\nPer-section Basis\nTo enable the $\\KaTeX$ support in a particular section, add math = true under [extra] in the [SECTION_NAME]/_index.md.\nNow the katex shortcode will be rendered, you can also add math_auto_render = true\nand the section of your site will load the KaTeX autorender extension.\n+++\n[extra]\nmath = true\n+++\n\nPer-page Basis\nTo enable the $\\KaTeX$ support in a particular page, add math = true under [extra] in the page\'s\nfrontmatter. Now the katex shortcode will be rendered, you can also add math_auto_render = true\nand the page of your site will load the KaTeX autorender extension.\n+++\n[extra]\nmath = true\nmath_auto_render = true\n+++\n\nIt is a good practice to enable $\\KaTeX$ support on a per-page basis, since this will only load the\nrequired files on that particular page, without affecting the page load speed of other pages.\nIf your site is not math-heavy, please do NOT enable this feature globally or per-section basis.\nUsage\nWrap any valid $\\KaTeX$ syntax with $...$ for inline\nMathematics and $$...$$ for block Mathematics.\nInline Mathematics\nThis is the most beautiful equation I\'ve ever seen:\nUsage\n{% katex(block=false) %} e^{i\\pi}+1=0 {% end %}\n\nOutput\n&lt;script type="math/tex"&gt;e^{i\\pi}+1=0&lt;/script&gt;\n\n\n\nBlock Mathematics\nSome Mathematics in display mode is fair enough:\nUsage\n{% katex(block=true) %} \\int_0^1 x^2 dx {% end %}\n\nOutput\n&lt;script type="math/tex;mode=display"&gt;\\int_0^1 x^2 dx&lt;/script&gt;\n\n\n\nAuto Render Inline Example\n$ e^{i\\pi}+1=0 $\n\n$ e^{i\\pi}+1=0 $\nAuto Render Block Example\n$$\nf(x) = \\int_{-\\infty}^\\infty\\hat f(\\xi)\\,e^{2 \\pi i \\xi x}\\,d\\xi\n$$\n\n$$\nf(x) = \\int_{-\\infty}^\\infty\\hat f(\\xi),e^{2 \\pi i \\xi x},d\\xi\n$$\n',id:"https://ajaxbits.com/blog/overview-math/",title:"Mathematical Notations"},"https://ajaxbits.com/blog/overview-rich-content/":{body:'Several custom shortcodes are included to augment CommonMark (courtesy of d3c3nt theme), in addition to those already provided by Zola. video, image, gif, and audio were created to help you take advantage of modern HTML elements in your writing.\nVideo\nThe video shortcode takes a sources parameter (an array of strings)\nand returns a &lt;video&gt; tag. Each string in the sources array should\nbe a path to a video file of a different type (webm, mp4, etc). Each\nindividual source is then converted into a &lt;source&gt; tag, and the\nelement is returned.\nUsage\n{{ video(sources=["over9000_av1.mp4", "over9000_vp9.webm"]) }}\n\nOutput\n&lt;video controls&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000_av1.mp4" type="video/mp4" /&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000_vp9.webm" type="video/webm" /&gt;\n  Your browser doesn\'t support the video tag and/or the video formats in use here –&nbsp;sorry!\n&lt;/video&gt;\n\n\n\n  \n  \n  Your browser doesn\'t support the video tag and/or the video formats in use here –&nbsp;sorry!\n\nImage\nThe image shortcode returns a &lt;picture&gt; tag and accepts three\nparameters: sources (an array of strings), fallback_path, and\nfallback_alt (both strings).\nEach string in the sources array should be a path to an image file of\na different type (webp, png, jpg, etc). fpath and\nfalt are used to create an &lt;img&gt; tag for the browser to fall\nback on if the other formats aren\'t yet supported, fw and fh set the width and height of the fallback\nUsage\n{{ image(sources=["over9000-960.webp", "over9000-640.webp", "over9000-400.webp"], fpath="over9000-640.webp", fw=640, fh=480, falt="ITS OVER 9000!") }}\n\nOutput\n&lt;picture&gt;\n  &lt;source srcset="https://ajaxbits.com/blog/overview-rich-content/over9000-960.webp" type="img/webp" /&gt;\n  &lt;source srcset="https://ajaxbits.com/blog/overview-rich-content/over9000-640.webp" type="img/webp" /&gt;\n  &lt;source srcset="https://ajaxbits.com/blog/overview-rich-content/over9000-400.webp" type="img/webp" /&gt;\n  &lt;img src="over9000-640.webp" alt="ITS OVER 9000!" width="640" height="480" /&gt;\n&lt;/picture&gt;\n\n\n\n  \n  \n  \n  \n\nGIF\nThe gif shortcode is exactly the same as the video shortcode\n– it takes an array of strings called sources and returns a\n&lt;video&gt; tag. The only difference is in the outermost tag, which has\nfour additional properties: autoplay, loop, muted, playsinline.\nUsing the &lt;video&gt; tag in place of gifs allows for reduced file sizes,\nwhich is especially important in regions where internet is slower or\nless reliable.\nUsage\n{{ gif(sources=["over9000_av1.mp4", "over9000_vp9.webm"]) }}\n\nOutput\n&lt;video autoplay loop muted playsinline&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000_av1.mp4" type="video/mp4" /&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000_vp9.webm" type="video/webm" /&gt;\n  Your browser doesn\'t support the video tag, which I use in place of .gifs, and/or the video formats in use here –&nbsp;sorry!\n&lt;/video&gt;\n\n\n\n  \n  \n  Your browser doesn\'t support the video tag, which I use in place of .gifs, and/or the video formats in use here –&nbsp;sorry!\n\nAudio\nThe audio shortcode takes a sources array of strings and returns an\n&lt;audio&gt; tag. Each string in the sources array should be a path to an\naudio file of a different type (ogg, mp3, flac, wav, etc).\nThe browser will play the first type it supports, so placing them in order of size smallest to largest will use the least bandwidth if that is your goal.\nUsage\n{{ audio(sources=["over9000.ogg", "over9000.mp3", "over9000.flac", "over9000.wav"]) }}\n\nOutput\n&lt;audio controls&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000.ogg" type="audio/ogg" /&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000.mp3" type="audio/mp3" /&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000.flac" type="audio/flac" /&gt;\n  &lt;source src="https://ajaxbits.com/blog/overview-rich-content/over9000.wav" type="audio/wav" /&gt;\n  Your browser doesn\'t support the audio tag and/or the audio formats in use here –&nbsp;sorry!\n&lt;/audio&gt;\n\n\n\n  \n  \n  Your browser doesn\'t support the audio tag and/or the audio formats in use here –&nbsp;sorry!\n\n',id:"https://ajaxbits.com/blog/overview-rich-content/",title:"Rich Content"},"https://ajaxbits.com/blog/pages/":{body:"",id:"https://ajaxbits.com/blog/pages/",title:""},"https://ajaxbits.com/blog/posts/":{body:"",id:"https://ajaxbits.com/blog/posts/",title:"posts"},"https://ajaxbits.com/blog/privacy/":{body:"Privacy\n\nThis site does not set or use cookies.\nThis site does not store data in the browser to be shared, sent, or sold to third-parties.\nNo personal information is shared, sent, or sold to third-parties.\n\nEffective Date: 1st Jan 2023\n",id:"https://ajaxbits.com/blog/privacy/",title:"Privacy Policy"}},docInfo:{"https://ajaxbits.com/blog/":{body:0,title:0},"https://ajaxbits.com/blog/about/":{body:63,title:0},"https://ajaxbits.com/blog/contact/":{body:0,title:1},"htt